INSERT INTO `memo` VALUES (1, '新年快乐', '又是新的一年大家新年快乐', '<p></p><p>find($id)需要一个id并返回一个模型。如果不存在匹配的模型，则返回null。&nbsp;</p><p>findOrFail($id)需要一个id并返回一个模型。如果不存在匹配的模型，则会引发错误, 它会抛出一个error。&nbsp;</p><p>first()返回在数据库中找到的第一条记录。如果不存在匹配的模型，则返回null。&nbsp;</p><p>firstOrFail()返回在数据库中找到的第一条记录。如果不存在匹配的模型，则会引发错误。它会抛出一个error。<img src=\"data:image/jpeg;base64,\" style=\"max-width: 100%;\"></p>', '2020-07-07 11:29:22', '2020-07-07 11:29:22');
INSERT INTO `memo` VALUES (2, '用户管理', '又是新的一年大家新年快乐', '<p></p><p><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"><br></p><p>昨天吃大排档，边上桌一小哥，半醉了，天南地北瞎扯（普通话不标准），说：\"外，外地人在，在，在本地，都，都是猪，猪，猪。。\"</p><p></p><p>还没说完，旁边一桌一大汉站起来一嘴巴就扇过去。。那小哥眼睛一瞪，继续说：“租，租，租房的居多。”然后嘣一声就倒地了&nbsp;&nbsp;<br></p>', '2020-07-07 11:31:38', '2020-07-07 11:31:38');
