INSERT INTO `volunteer` VALUES (1, '中国人寿', '帮助', '<p></p><blockquote>find($id)需要一个id并返回一个模型。如果不存在匹配的模型，则返回null。&nbsp;</blockquote><p>findOrFail($id)需要一个id并返回一个模型。如果不存在匹配的模型，则会引发错误, 它会抛出一个error。&nbsp;</p><blockquote>first()返回在数据库中找到的第一条记录。如果不存在匹配的模型，则返回null。&nbsp;</blockquote><p>firstOrFail()返回在数据库中找到的第一条记录。如果不存在匹配的模型，则会引发错误。它会抛出一个error。</p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"><br></p>', '1', '2020-07-09 09:00:00', '2020-07-09 18:00:00', '2020-07-07 14:45:34', '2020-07-07 14:45:34');
